def validify(file):
	soup = BeautifulSoup(file, 'html.parser')
	
	title = soup.title.string.encode('ascii', 'ignore')
	if 'Messages' not in title:
		return False
	
	contents = soup.find_all('div', class_='contents')
	if len(contents) != 1:
		return False
	
	header = soup.find('h1')
	if header is None:
		return False
	
	threads = soup.find('div', class_='thread')
	if len(threads) < 1:
		return False

	return True